      "full_text" : "The aliases for both those commands are:\n\ngit uncommit =&gt; git reset HEAD~1\ngit recommit =&gt; git commit --reedit-message=HEAD@{1}\n\nThis is quite useful but can be fiddly (if you `amend` instead of `recommit` you'll hate yourself). If someone has a better approach, I'm all ears.",
