      "full_text" : "I'll \"uncommit\" to put all the current commit's changes back into the working directory, make a fix, and then \"recommit\" when I'm ready.\n\n$ git rb\n# `edit` a commit.\n$ git uncommit # Put commit into the working directory\n# Make the change.\n$ git recommit # Restore commit message",
      "lang" : "en",
