      "created_at" : "Tue Sep 13 21:57:59 +0000 2022",
      "favorited" : false,
      "full_text" : "A few related aliases I have are:\n\n# Amend and keep the original commit message.\ngit amend =&gt; git commit --amend --no-edit\n\n# Interactive rebase of a feature branch.\ngit rb =&gt; git rebase -i main\n\n# Execute command for each commit in the feature.\ngit rbx =&gt; git rebase main --exec",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
      "in_reply_to_user_id_str" : "1189618278848532480"
