      "full_text" : "Another workflow: When I want to fix a bug and make sure it works at the *end* of the branch, but actually *commit* it earlier. I'll do:\n\n$ git checkout ${BRANCH}\n# Edit and test the change.\n$ git commit -m \"WIP\"\n$ git rebase -i main\n# Move WIP to the middle and use `fixup`.",
