      "full_text" : "One common workflow: When I need to respond to a comment on a PR about some commit in the middle, I'll usually do something like:\n\n$ git rebase -i main\n# `edit` the relevant commit.\n# Make the fix.\n$ git commit --amend\n$ git rebase --continue",
