      "full_text" : "I'm struggling to think of a good reason why a proper spec for JS type syntax would be better than browsers implementing real TS syntax as a dev-only feature.\n\nWhat do you think? Anything I might be missing? Super interested to hear your thoughts. ü§îüí≠",
