      "favorited" : false,
      "full_text" : "@IgorMinar Personally, I'd rather see:\n\n1. Prerelease labels are inherently incomparable.\n2. Installing `^1.0.0-next.0` can give later patches like `1.0.0-next.1`.\n3. Installing `^1.0.0-next` will *never* give a different label (`1.0.0-rc.0`).",
      "lang" : "en",
