      "favorited" : false,
      "full_text" : "#TIL semver precedence for prerelease tags is alphabetical, so:\n\n1.0.0-alpha &lt; 1.0.0-beta üòÄ\n*but*\n1.0.0-gamma &gt; 1.0.0-delta üòï\n\nThis feels very unintuitive to me, as the semantics of each tag can't be clearly defined. I feel like such tags should be incomparable.",
