      "full_text" : "Now if only we could somehow make:\n\n```\n(value: T) =&gt; !!value\n```\n\ninfer to\n\n```\n(value: T): value is NonNullable&lt;T&gt; =&gt; !!value\n```\n\nwe'd be golden.\n\nIs there any reason the compiler can't do that? It already type narrows, we'd just need to plumb it through to the return type.",
