      "created_at" : "Tue Dec 14 01:26:32 +0000 2021",
      "favorited" : false,
      "full_text" : "Sidebar: Is there any tooling which helps ensure that a dependency version bump *doesn't* change the supported engines of a package? This applies to transitive dependencies, so is there some way to confirm that I'm not introducing a breakage for users by updating a dependency.",
