      "created_at" : "Tue Dec 07 01:15:59 +0000 2021",
      "favorited" : false,
      "full_text" : "@typescript I can agree with some of the specific points, but I don't see them as a compelling argument. Not every enum has a \"Zero like\" value and this is a very easy mistake to make with a complex \"rethink the way you are designing enums\" solution that most devs won't think of up front.",
