      "created_at" : "Tue Dec 07 01:10:15 +0000 2021",
      "favorited" : false,
      "full_text" : "This seems to have come up before in the @typescript repo but was dismissed because truthy/falsey behavior is occasionally useful and other languages have the same hazard. They suggest that the `0` value should be the \"Zero like\" or \"unspecified\" value.\n\nhttps://t.co/rHw25vLVbw",
      "lang" : "en",
