      "favorited" : false,
      "full_text" : "Not sure what the point of this was, but I guess this is a fun fact about Chrome? If you enable any policy registry key, it just assumes you're on a managed device with no additional configuration required.\n\nThat was a fun 30 minutes.",
      "lang" : "en",
