      "created_at" : "Sat Nov 13 05:01:45 +0000 2021",
      "favorited" : false,
      "full_text" : "Apparently a side effect I hadn't noticed is that setting this policy meant that Chrome assumed this device was managed by organization, even though there was no other information to that effect on the device. Deleting this key removes the \"Your device is managed\" message.",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
