      "full_text" : "The actual APIs are pretty simple IMHO. An SSR component is simply a class with a render function which returns a string. It defines build-time data required as input, registers itself with the server, and defines its types, much like #WebComponents.\n\nhttps://t.co/ZAGQSZtpqm",
