      "created_at" : "Thu Oct 07 23:47:17 +0000 2021",
      "favorited" : false,
      "full_text" : "I could look at word count, but I don't have a mental model to use as a frame of reference. Is 1,000 words a lot?\n\n\"How big is the scrollbar?\" is probably the closest comparison, but varies by device and is harder to communicate to others (\"one viewport\" = \"one pager\"?)",
