      "created_at" : "Sat Sep 25 07:28:59 +0000 2021",
      "favorited" : false,
      "full_text" : "I've never understood the convention that generics have one character names. You wouldn't let a one character variable name past code review?\n\nI get that in simple cases it can be hard to find a good name, but which is better?\n\n* class List&lt;T&gt; {}\n* class List&lt;Item&gt; {} https://t.co/FfT9O24do2",
