      "created_at" : "Tue Aug 17 18:36:22 +0000 2021",
      "favorited" : false,
      "full_text" : "My point is that while the performance is bad, it's just not a very convenient or helpful tool. #Golang and #Rust both embed this information in their types, making it much easier to reason about and utilize for common tasks.",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
      "in_reply_to_user_id_str" : "1189618278848532480"
