      "full_text" : "Try catch is awful. This thread talks a lot about the performance implications, but even syntactically it's weird. How often do you do:\n\n```\nstring? str = null;\ntry {\n  str = trySomething();\n} catch {\n  str = somethingElse();\n}\n```\n\nScoping is awkward and the type includes null. https://t.co/oybLLMQsMc",
