      "favorited" : false,
      "full_text" : "I would expect it to fail because doing:\n\n```\nconst instance: Parent = new Child();\nhttps://t.co/DjKiblAAHU(0); // Child expects\n```\n\nIs putting a `number` into a function that expects only a `string`. I'm very surprised to find that this compiles successfully.",
