      "favorited" : false,
      "full_text" : "Misusage of defaults is what makes them so difficult to change and causes breaking changes that didn't need to be there to begin with.",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
      "in_reply_to_user_id_str" : "1189618278848532480"
