      "full_text" : "2. I expected to not like `MonoBehaviour` and that one would slowly grow to encompass most of my game logic, but that didn't happen.\n\nThinking of them as a mixin, sometimes providing an API to be consumed by another behavior, I was able to make decent abstractions.",
