      "created_at" : "Tue May 25 04:38:38 +0000 2021",
      "favorited" : false,
      "full_text" : "Given more time, it would be fun to write tooling around the randomizer to make it a more powerful, game-agnostic tool.\n\nA CLI, portability, and a properly specified logic file format could make it pretty useful to other randomizers out there.",
      "lang" : "en",
