      "favorited" : false,
      "full_text" : "I was pretty proud to write a randomization algorithm which:\n\n1) Has no dependency on the actual game it is randomizing (everything is represented in the input logic file).\n2) Has an upper-bounded complexity (no \"guess and check\").\n3) Is fairly portable (can run in #WebAssembly).",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
