      "favorited" : false,
      "full_text" : "Instead, I was mostly having fun with the tech, learning #Unity and #csharp. It's also very different to design game systems (very OO mindset) which I'm not super familiar with as a web dev.\n\nAlso got to explore the very interview question-y design of the randomization algorithm.",
