      "created_at" : "Tue May 25 04:38:37 +0000 2021",
      "favorited" : false,
      "full_text" : "I was wondering, \"What would a game look like if it were designed from scratch as a #randomizer?\" (the #Zelda variety at least)\n\nI can confidently say I made no progress on that question as you definitely can't figure that out in a week (maybe I'll write a blog post someday).",
