      "created_at" : "Sun May 16 09:01:39 +0000 2021",
      "favorited" : false,
      "full_text" : "You can use delegates to kind of do the same thing in #csharp, but it's still mutating state and the compiler doesn't understand it like #Haskell does.\n\nI don't really have a point to make here, just sharing some interesting stuff I learned today.",
