      "favorited" : false,
      "full_text" : "Like most esoteric #ComputerScience problems, the answer is: functional programming languages.\n\nFor example, #Haskell does this by \"tying the knot\", leveraging laziness to define two symbols that reference each other. ü§Ø\n\nhttps://t.co/daRwVCyVrD",
