      "created_at" : "Sun May 16 09:01:39 +0000 2021",
      "favorited" : false,
      "full_text" : "Mutability works around this because you can just construct A without a reference to B (such as `null`) then add it later once you've made B.\n\nThis made me wonder, are there other languages which can provide a compiler-guaranteed immutable *and* circular data structure? ü§î",
