      "favorited" : false,
      "full_text" : "The reason for this is because you can't construct an immutable object without having all its dependencies first. So if A &lt;-&gt; B, you can't construct A without B, but you also can't make B without A.",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
