      "full_text" : "#unpopularopinion, #programminglanguage's should *not* use + for concatenation.\n\nDue to a mathematical origin, + implies a commutative operation, which string or array concatenation does not satisfy.\n\n`a + b != b + a` if concatenation uses the same syntax as addition.",
