      "full_text" : "This sounds like a way more standardized and simple alternative to #Adobe #PDFs. The forms could be arbitrarily complex, calling backend APIs if desired.\n\n#GoogleDocs already can export to HTML, it could trivially support this system. #Wix and #Squarespace could help here too.",
