      "created_at" : "Thu Nov 05 23:12:52 +0000 2020",
      "favorited" : false,
      "full_text" : "For example, a company sends me a *.webbundle file, and double-clicking it opens the page in a browser with a simple form. I complete the form and save it back to the same file. I can then send that file back to the company, where they can view the data I entered.",
      "lang" : "en",
