      "favorited" : false,
      "full_text" : "#Idea: The #WebBundles specification, but with a #JavaScript API that allows a page to write user data directly into the package and save it back to the file system.\n\nThis could use web apps as a simple replacement for #PDF. Just send me the form, I fill it out, and send it back.",
