      "created_at" : "Thu Oct 08 06:22:40 +0000 2020",
      "favorited" : false,
      "full_text" : "#Steam won't let me start the game in regular reality mode with the headset plugged in. So now I have to unplug the headset, start the game in non-VR, close the EA account popup (which appears on **every** game start), plug in the headset, and **then** switch to VR.",
      "lang" : "en",
