      "created_at" : "Thu Oct 08 06:22:39 +0000 2020",
      "favorited" : false,
      "full_text" : "I try starting the game (outside of VR because apparently I have to do that) and #Steam stops me to say the game supports VR natively. Like, ok, thanks?\n\nI then start anyways, and find myself in a theatre, playing the game in 2D. So I guess I triggered a different VR mode?",
