      "full_text" : "I'm then presented with a \"Log in to your #EA account\" screen, in VR. Aside from the fact that this corporate nonsense is between me and my game, I was **unable** to interact with this form in VR!\n\nI could see the close button, but I was unable to press it, with any input system.",
