      "full_text" : "Then #OculusLink and the #Oculus app both needed to update themselves. #Nividia also nagged me for an update, so I figured I may as well.\n\nI start the game in VR mode only to have it hang on the loading screen for several minutes. Alt+F4 and retry and it finally loads.",
