      "truncated" : false,
      "retweet_count" : "0",
      "id" : "1295242894782029825",
      "in_reply_to_status_id" : "1295242893590814720",
      "created_at" : "Mon Aug 17 06:15:45 +0000 2020",
      "favorited" : false,
      "full_text" : "This has been kinda negative overall, but I did enjoy the game a lot. Brute squads are tons of fun, level design is on point, scarabs are great; definitely set the standard for Halo going forward.\n\nI think I'll skip #ODST and move onto #Reach, interested to see how that holds up.",
