      "created_at" : "Mon Aug 17 06:15:43 +0000 2020",
      "favorited" : false,
      "full_text" : "Guilty Spark comes back just to make Chief press the button for Installation 04b and then turn on Johnson. He's a pretty crappy boss fight.\n\nIn fact, both control rooms were crying out for a Gravemind boss fight we never got. The coolest villain gets no send off.",
      "lang" : "en",
