      "created_at" : "Mon Aug 17 06:15:43 +0000 2020",
      "favorited" : false,
      "full_text" : "The story is... par... for Halo games. Characters are still pretty \"meh\". Miranda and Johnson die but I don't really care (#SpoilerAlert). Cortana is barely in it and the Arbiter has nothing to do because he can't be 10 feet away from Chief or else co-op would be weird.",
      "lang" : "en",
