      "full_text" : "There are new Brute weapons but they mostly all suck. Spiker in particular is awful and the Mauler is just a poor man's shotgun.\n\nThe BR and Carbine are still top-tier. Especially since they can \"headshot\" pods in the Flood (a cool idea that just makes the good guns even better).",
