      "created_at" : "Mon Aug 17 06:15:42 +0000 2020",
      "favorited" : false,
      "full_text" : "I think adding a lot more equipment would encourage players to spend them more regularly in combat and potentially get more use out of them.\n\n#Reach tried a reusable approach, which has its own issues, but that's a tweet for another time.",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
      "in_reply_to_user_id_str" : "1189618278848532480"
