      "created_at" : "Mon Aug 17 06:15:40 +0000 2020",
      "favorited" : false,
      "full_text" : "Earth looks a lot better now, not so dull and brown, though it still has a bit of an uninspired aesthetic. The Ark looks cool from space, but on the ground it's just another ring world.\n\nIn particular, marine and Brute armor looks ridiculous, and I just can't take them seriously.",
      "lang" : "en",
