      "full_text" : "I started out on Heroic, but added Mythic, Thunderstorm, and Tough Luck skulls when it seemed a bit easy. I really like using skulls to customize difficulty. I didn't want to switch to Legendary, as I figured it would be more fun to have tougher enemies than a weaker player.",
