      "created_at" : "Sun Aug 09 09:41:37 +0000 2020",
      "favorited" : false,
      "full_text" : "That's about everything that comes to mind. Again, Halo 2 is not a bad game, but compared to it's predecessor, it just doesn't stand up.\n\nI guess I'll have to move on to Halo 3 and see how well that game actually aged.",
      "lang" : "en",
