      "full_text" : "That's using **entry** level salary numbers, a real team would have senior and mid-level engineers making more than that, this is easily over $1 MILLION dollars per year, just waiting on page loads!\n\nSupposedly, Google pays well above market too! I can neither confirm nor deny...",
