      "created_at" : "Wed Jul 29 23:28:02 +0000 2020",
      "favorited" : false,
      "full_text" : "In the world of #software, 7 employees is a reasonably sized team; they could ship the next great #mobileapp or #webapp.\n\nWant monetary value? Indeed says the average US software engineer's entry salary is ~$115k.\n\n7.2 * $115k = $828k per year *annually*.\n\nhttps://t.co/j9gPvUPkO9",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
