      "created_at" : "Wed Jul 29 23:28:01 +0000 2020",
      "favorited" : false,
      "full_text" : "Wikipedia says there are ~115,000 employees at Google. So 115,000 * 7.5 minutes = 862,500 minutes lost annually. That's 14,375 hours or ~1,800 (8 hr) working days!\n\nTo put that in perspective, there are 250 working days in 2020. 1,800 / 250 = 7.2 employees' annual working time!",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
      "in_reply_to_user_id_str" : "1189618278848532480"
