      "favorited" : false,
      "full_text" : "#TypeScript style:\n\nconst app = startApp();\n\n* May refuse to start app and return null.\n* startApp() has all the power.\n\nconst app = startApp()!;\n\n* Result is demanded non-null.\n* Programmer asserts themselves and bends reality to their will.\n* App knows it damn-well better start",
      "lang" : "en"
