      "created_at" : "Sun Jun 21 01:14:23 +0000 2020",
      "favorited" : false,
      "full_text" : "Based on this, I remembered @DasSurma's #Comlink library which solves a similar problem of communicating with web workers. It works with direct #JavaScript objects in a much simpler and lighter-weight manner.\n\nhttps://t.co/8bavJi93Kl",
      "lang" : "en",
