      "created_at" : "Sun Jun 21 01:13:26 +0000 2020",
      "favorited" : false,
      "full_text" : "2. `protoc` cannot output #TypeScript types.\n\nUsers are forced into community projects to generate typings for emitted #JavaScript. I was hoping to limit protobuf dependencies to #Google's officially supported projects only, but that simply isn't viable with #TypeScript.",
      "lang" : "en",
