      "created_at" : "Sun Jun 21 01:13:26 +0000 2020",
      "favorited" : false,
      "full_text" : "1. `protoc` (the protobuf compiler) cannot output #JavaScript using ES modules.\n\nYou're forced into #CommonJS (or #Closure modules), which necessitates the use of a bundler for a browser extension which (surprisingly) would not need one otherwise.",
      "lang" : "en",
