      "created_at" : "Sun Jun 21 01:13:26 +0000 2020",
      "favorited" : false,
      "full_text" : "This problem isn't specific to #ProtocolBuffers, BTW. Any Interface Definition Language (IDL) would have the same problem.",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
      "in_reply_to_user_id_str" : "1189618278848532480"
