      "full_text" : "I was able to build this system as a couple NPM packages, but felt it was far too unwieldy to actually use.\n\nThe getting started guide really exemplifies just how much effort it is to actually set up #BXPB with no path to making it any simpler.\n\nhttps://t.co/CZRLW9CeMh",
