      "created_at" : "Sun Jun 21 01:13:24 +0000 2020",
      "favorited" : false,
      "full_text" : "I decided to use #ProtocolBuffers as a serializable data format to send across contexts.\n\nhttps://t.co/i3HrQO8YAT\n\nProtobufs already have the concept of a \"service\", so BXPB simply compiled a .proto file into a JavaScript client and service which communicate using messaging APIs.",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
