      "full_text" : "This means that cross-communication between the different contexts is critical, as many user stories require multiple contexts working in harmony.\n\nFor example, a button in a popup that changes a page requires popup, background, and content scripts all working together cohesively",
      "lang" : "en",
      "in_reply_to_screen_name" : "develwoutacause",
      "in_reply_to_user_id_str" : "1189618278848532480"
