      "created_at" : "Sun Jun 21 01:13:23 +0000 2020",
      "favorited" : false,
      "full_text" : "Browser extensions often run code in many different \"contexts\": an injected content script, a #DevTools panel, a background script, a popup box, etc.\n\nEach context has different privileges and APIs available. For example, only a content script can modify a web page's DOM.",
