      "full_text" : "@Jakeherringbone ASI gets some situations wrong. An example I saw once:\n\n```\nconst a = b\n[ 1, 2, 3 ].map(console.log)\n```\n\nThis actually throws because ASI doesn't insert on the first line (thinking b is an array). It incorrectly merges the two lines together.\n\nExplicit semicolons FTW.",
