      "full_text" : "I sure do love $HYPED_TECHNOLOGY and will use this article to defend it in online arguments against $VAGUELY_SIMILARLY_BUT_NOT_REALLY_COMPETING_TECHNOLOGY.\n\nhttps://t.co/JFCUBllf03",
