      "full_text" : "For example: If `getPromise()` calls some backend, using `from()` will send the HTTP request immediately, even if the resulting `Observable` is never subscribed to!\n\n`defer()` will wait to send the HTTP request until it's actually needed.",
      "lang" : "en",
